import React, { Component } from "react";

class website extends React.Component {
  render() {
    const styleObj = {
      fontSize: 36,
      color: "#4a54f1",
      textAlign: "center",
      paddingTop: "100px",
    };
    return (
      <div>
        <h1 style={styleObj}>LECTURE VIDEOS => SUMMARIZED TRANSCRIPTS</h1>
        <h3>
          Speed-running recorded lectures not good enough for you? Get a clean,
          readable summary of it instead!
        </h3>
        <button
          // onClick={() => this.handleIncrement(product)}
          className="btn m-4 btn-primary btn-sm"
        >
          Upload
        </button>
        <p>X minutes of videos uploaded!</p>
        <p>X minutes of words removed!</p>
        <p>X% summary satisfaction rate!</p>
      </div>
    );
  }
}

export default website;
